import React from 'react';

const NavBar = () => {
  return (
    <nav style={styles.navbar}>
      <div style={styles.logo}>Your Logo</div>
      <div style={styles.navItems}>
        <ul style={styles.navList}>
          <li style={styles.navItem}><a href="#home" style={styles.link}>Home</a></li>
          <li style={styles.navItem}><a href="#contact" style={styles.link}>Contact Us</a></li>
        </ul>
        <div>
          <button style={{ ...styles.button }}>Sign In</button>
          <button style={{ ...styles.button }}>Sign Up</button>
        </div>
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    backgroundColor: '#4285f4',
    padding: '10px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    color: '#fff',
    borderBottom: '1px solid #fff',
    flexDirection: 'row',
  },
  logo: {
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navItems: {
    display: 'flex',
    alignItems: 'center',
  },
  navList: {
    listStyle: 'none',
    display: 'flex',
    margin: 0,
    padding: 0,
  },
  navItem: {
    margin: '0 15px',
  },
  link: {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '1rem',
  },
  button: {
    backgroundColor: '#fff',
    color: '#4285f4',
    padding: '8px 15px',
    border: 'none',
    borderRadius: '5px',
    margin: '0 5px',
    cursor: 'pointer',
  },
  '@media (max-width: 1200px)': {
    navItem: {
      margin: '0 10px',
    },
  },
  '@media (max-width: 768px)': {
    navbar: {
      flexDirection: 'column',
      alignItems: 'flex-start',
    },
    navList: {
      marginTop: '10px',
      marginLeft: '0',
    },
    navItem: {
      margin: '5px 0',
    },
  },
  '@media (min-width: 769px)': { // Add this media query for desktop screens
    navbar: {
      flexDirection: 'row',
      alignItems: 'center',
    },
    navList: {
      marginTop: '0',
      marginLeft: 'auto',
    },
    navItem: {
      margin: '0 15px',
    },
  },
};

export default NavBar;
